import React, { useState } from 'react';
import { Container, Col, Form, Button, Card, Spinner } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/LoginForm.css';

const LoginForm = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [showOverlay, setShowOverlay] = useState(false);

  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);
    setShowOverlay(true);

    fetch('https://sheetdb.io/api/v1/131pnl5khpeib')
      .then(res => res.json())
      .then(data => {
        const user = data.find(
          (entry) =>
            entry.RollNo === username.trim() &&
            entry.Password === password.trim()
        );

        if (user) {
          navigate('/learnerPerformance', { state: { learnerData: [user] } });
        } else {
          alert('Invalid Roll Number or Password');
        }
      })
      .catch((err) => console.error('Error:', err))
      .finally(() => {
        setLoading(false);
        setShowOverlay(false);
      });
  };

  return (
    <>
      {showOverlay && <div className="overlay" />}
      <Container fluid className="login-container">
        <Col md={4}>
          <Card className="login-card">
            <Card.Body>
              <img
                src="https://v.fastcdn.co/u/67ec1086/61513884-0-Unacademy-Logo-RGB.png"
                alt="Unacademy logo"
                className="logo-image"
              />
              <h1 className="text-center login-title">AHMEDABAD CENTRE</h1>
              <h2 className="text-center login-title">Learner Login</h2>

              <Form onSubmit={handleSubmit}>
                <Form.Group className="form-group-custom">
                  <Form.Label>Roll Number</Form.Label>
                  <Form.Control
                    type="text"
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                    className="form-control-custom"
                    required
                    placeholder="Enter your Roll Number"
                  />
                </Form.Group>

                <Form.Group className="form-group-custom">
                  <Form.Label>Password</Form.Label>
                  <Form.Control
                    type="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    className="form-control-custom"
                    required
                    placeholder="Enter Password"
                  />
                </Form.Group>

                <Button
                  variant="primary"
                  type="submit"
                  className="submit-button"
                  disabled={loading}
                >
                  {loading ? <Spinner size="sm" animation="border" /> : 'Show Report'}
                </Button>
              </Form>

              <div className="social-icons">
                <a href="https://www.facebook.com/unacademyahmedabad/" target="_blank" rel="noreferrer">
                  <i className="fab fa-facebook-f"></i>
                </a>
                <a href="https://www.youtube.com/@UnacademyNEET" target="_blank" rel="noreferrer">
                  <i className="fab fa-youtube"></i>
                </a>
                <a href="https://twitter.com/unacademy" target="_blank" rel="noreferrer">
                  <i className="fab fa-twitter"></i>
                </a>
                <a href="https://www.instagram.com/unacademy.ahmedabad/" target="_blank" rel="noreferrer">
                  <i className="fab fa-instagram"></i>
                </a>
                <a href="https://www.linkedin.com/company/unacademy" target="_blank" rel="noreferrer">
                  <i className="fab fa-linkedin-in"></i>
                </a>
              </div>
            </Card.Body>
          </Card>
        </Col>
      </Container>
    </>
  );
};

export default LoginForm;
